public long getEarliestStartTime() {
  readLock.lock();
  try {
    if (cumulativeCapacity.isEmpty()) {
      return -1;
    } else {
      return cumulativeCapacity.firstKey();
    }
  } finally {
    readLock.unlock();
  }
}
